import React from 'react'
import {HashRouter, Route, Switch, BrowserRouter, Link} from 'react-router-dom'
import Charity from './Charity'
import Donator from './Donator'
import Homepage from './Homepage'
// import DonatorLogin from './donatorLogin'
// import DonatorSignup from './donatorSignup'
import CharitySignup from './charitySignup'
import {useEffect} from 'react'


const BasicRoute = () => {
    useEffect(() => {
        document.title = "donationCoin"
     }, []);
    return (
        <HashRouter history={BrowserRouter}>
            <Switch>
                <Route exact path="/" component={Homepage}/>
                <Route exact path="/charity" component={Charity}/>
                <Route exact path="/donator/:name" component={Donator}/>

                <Route exact path="/donator/donatorlogin" component={Donator}/>
                <Route exact path="/donator/donatorsignup" component={Donator}/>
                <Link to="/donator/donatorlogin"></Link>
                <Link to="/donator/donatorsignup"></Link>

                <Route exact path="/charitysignup" component={Charity}/>
            </Switch>
        </HashRouter>
    )
}

export default BasicRoute;
